import React,{Component} from 'react' ;
import axios from 'axios' ;


class Home extends Component{



componentDidMount(){

axios.get('https://jsonplaceholder.typicode.com/photos')
.then(response => {
  console.log(response.data.slice(0,8));
  } 
 );



}


render() {
    


return(

    <div>
      <div className="row  ">
      <div className="col s12 main-column "> 
        
        <div className="col s6 ">
          <div className="brand-text"> 
          <h3 className="center-align ">Hello Visitor </h3>
         <h5 className="center"> Welcome to Shop Developed in React ! <br/>  We are glad to serve you ! </h5>
         <a className="waves-effect waves-light btn call-to-action"><i class="material-icons left">call</i>Call Now</a>
        
         </div> 
        </div>


      </div>

      {/* <div className="col s6 left-column"> 
        <h3 className="center-align">left World </h3>
      </div>

       <div className="col s6 right-column"> 
         <h3 className="center-align">Right World </h3>
        </div>
         */}



        <div className="col s6">

        <div className="card">
        <div className="card-image">
          <img src="https://materializecss.com/images/sample-1.jpg"/>
          <span className="card-title">Card Title</span>
        </div>

        <div className="card-content">
          <p>I am a very simple card. I am good at containing small bits of information.
          I am convenient because I require little markup to use effectively.</p>
        </div>
        
      </div>

        </div>





      </div>
    </div>

    );
        }
}

export default Home ;
